from sympy import isprime
def ok(n):
    if not isprime(n): return False
    t = int(str(n)+str(2*n))
    return isprime(t-1) and isprime(t+1)
print([k for k in range(20000) if ok(k)]) # _Michael S. Branicky_, Aug 07 2022

